css:
.item-count-box {
  float: right;
  min-width: 26px;
  text-align: center;
  display: inline;
  font-size: 12px;
  padding: 1px 5px 1px 5px;
  margin-top: 3.5px;
  line-height: 20.9px;
  border-radius: 3px;
}
.template-picker .menu .content-container {
  height: 150px;
  overflow-y: scroll;
}
.template-picker .menu .footer-container {
  border-top: 1px solid #dddddd;
}
.template-status-bar {
  background-color: #fcf4db;
  color: #695209;
  border: 1.5px solid #f8e6ac;
  border-radius: 3px;
  padding-top: 5px 10px 5px 10px;
  font-size: 13.95px;
}
.compose-body #contenteditable code.var {
  font: inherit;
  padding: 0;
  padding-left: 2px;
  padding-right: 2px;
  border-bottom: 1.5px solid #f8e6ac;
  background-color: rgba(252, 244, 219, 0.1);
}
.compose-body #contenteditable code.var.empty {
  color: #695209;
  border-bottom: 1px solid #f7e099;
  background-color: #fcf4db;
}
